import React from "react";

export default function ServiceCard (props){
    return (
        <div className="service-card">
            <div classNane="grid grid-cols-3 grid-rows-2 gap-4">
                <div className="row-span-1 row-start1">
                    {props.svg}
                </div>
                <div className="row-span-1 row-start-2">
                    {props.heading}
                </div>
            </div>
            {props.description}
        </div>
    );
}
